import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SharedService {

  constructor() { }

  isEmptyVal(val: any) {
    if (val == '' || val != null) {
      return true;
    } else {
      return false;
    }
  }
}
